import React from "react";

function CreateAccount() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>CREATE AN ACCOUNT</h1>
        <p>Enter Email</p>
        <p>Enter Username</p>
        <p>Enter Password</p>
        <p>Renter Password</p>
      </header>
    </div>
  );
} 

export default CreateAccount;
